        const account_id = temp[1];
        try {
            const query =fetch ('http://localhost:5000/transaction',{
                method : 'POST',
                headers : {'Content-Type':'application/json'}
            });
        } catch (error) {
            console.log(error);
        }

    };
    return(
    <form className='mt-5 jumbotron' onSubmit={DoTransaction}>
    <h1>Transaction</h1>
        <hr></hr>
    <div className="form-group">
    <label>Account ID</label>
    <input type="text" className="form-control" id="exampleInputEmail1" value={account_id} disabled required />
    <label >Branch ID</label>
    <input type="text" className="form-control" id="exampleInputPassword1" required/>
    <label >Amount</label>
    <input type="text" className="form-control" id="exampleInputPassword1" required/>
    <label >Action</label>
    <input type="text" className="form-control" id="exampleInputPassword1" required/>
    </div>

    <button type="submit" className="btn btn-primary">Add</button>
    </form>
  );  
};

export default FormTransaction;
